VALUES ('3281891108069', 'Croustillants a la violette de toulouse', 'Sucre, farine de blé, blancs d\'œufs, éclats de violette cristallisés 4.5% (sucre, fleurs naturelles de violette 2%, agent d\'enrobage : gomme d\'acacia, colorants : carmins et indigotine, arôme), amandes, arôme naturel. Traces possibles de noisettes et de lait. Les informations en gras sont destinées aux personnes intolérantes ou allergiques. Garanti sans OGM. A conserver à l\'abri de la chaleur et de l\'humidité. Refermer l\'étui après ouverture et consommer rapidement. Conditionné sous atmosphère protectrice. Crispy With candied violet petals, Ingredients: Sugar, wheat f/our, eggs whites, candied violet chips 4.5 % (sugar, natural violet f/owers 2 %, coating agent: acacia gum, coloring: carmine and indigotine, f/avor), almonds, natural flavor. Contains egg, gluten and nuts. May contain haze/nuts and milk. Bold information is intended for into/erant and a//ergic people. GMO free guaranteed. Please store away from heat and damp and keep cookies in an airtight container. Eat soon after opening. Packaged in a protective atmosphere.', 'https://static.openfoodfacts.org/images/products/328/189/110/8069/front_fr.3.400.jpg', '1.6', '0.2', '91', '72', '1.1', '4.6', '0.07', '0.0275590551181102', '', '0');

