VALUES ('3282620110230', 'Oeufs', 'Qualité et Proximité Vous avez choisi les Œufs de poules élevées au sol Baby Coque, preférant ainsi une production régionale vous garantissant fraicheur et authenti- cité. Nos volailles déambulent librement dans nos poulaillers, profitant de perchoirs, de zones de grattage et de nombreux nids pour pondre (haque jour des Œufs de qualité. Elles mangent a leur gre un aliment composé d\'au moins 65 de céréales, de protéines végétales, de minéraux et de vitamines. Soucieux de notre environnement, nous vous proposons un emballage écologique et biodégradable contribuant au bien-être de tous.', 'https://static.openfoodfacts.org/images/products/328/262/011/0230/front_fr.4.400.jpg', '0', '0', '0', '0', '', '0', '0', '0', '', '1');

