VALUES ('3283040048592', 'Le Suédois Poulet Cheddar', 'pain polaire 44.4% (farine de _blé_, farine de _seigle_, eau, sirop de sucre, sucre, _gluten de blé_, huile de colza, fibre de betterave, sel, amidon de pomme de terre, levure, poudre à lever : E503, fructose, farine de malt d\'_orge_, agent de traitement de farine : E300, enzymes, Lactobacillus plantarum), filet de poulet halal traité en salaison 33.3% (filet de poulet halal 25.6%, eau, sel, protéines de _soja_, acidifiant : E325, dextrose, arômes naturels, stabilisants : E450 et E451, épaississant : E407, antioxydant : E301), cheddar orange fondu 20% (_cheddar_ orange 10% minimum, _fromages_, _beurre_, eau, protéines de _lait_, amidon transformé de maïs, sels de fonte : E331 et E452, _lactosérum_, sel, arôme, gélifiant : E407, colorant : E160b), _beurre_.', 'https://static.openfoodfacts.org/images/products/328/304/004/8592/front_fr.13.400.jpg', '8', '4.7', '27', '4.1', '2.4', '9', '1.2', '0.47244094488189', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3283040051462', 'Pizza 3 fromage', 'pâte cuite 39% (farine de blé, eau, pcedte à lever : E500ii, huiie de colza, sel, levure), sauce tomate cuite 25,1% (purée de tomates mi-réduite, farine de blé, huile d\'olive vierge, eau, pulpe d\'ail, basilic, origan), emmental (dont fécule de pomme de terre) 14,4%, gouda 12,7%, cheddar orange fondu 6,4% [fromage (cheddar 3,3%), eau, amidon modifié de pomme de terre, beurre, protéines de lait, sel émulsifiant : E331, sel, colorant : El 60c], olives noires (olives, eau, sel, stabilisant : E 579), origan, basilic. Cette recette contient : gluten, lait. Traces de crustacés, mollusques, œuf, poissons et fruits à coque. AU FOUR : préchauffez votre four traditionnel 10 min. à 2200C. Ôtez la pizza de son emballage et placez-la sur la grille à mi-hauteur du four (pour plus de croustillant) ou dans un plat (pour plus de moelleux) et laissez cuire 5 à 7 min. Nous vous déconseillons l\'usage du four micro-ondes afin de préserver le crousti!lanl de pâte.', 'https://static.openfoodfacts.org/images/products/328/304/005/1462/front_fr.6.400.jpg', '10.5', '5.5', '26', '2.6', '2.3', '11.1', '1.75', '0.688976377952756', '', '0');

