VALUES ('3283040057426', 'Chicken burger bacon', 'Pain spécial aux graines de sesame 36,1% (farine de ble, eau, dextrose, levure, graines de sesame, huile de colza, sel, farine de fèves, émulsifiants : e471 et e481, antioxydant : e300), préparation de viande de filets de poulet reconstitués cuits traités en salaison 35,5% (viande de filet de poulets, eau, sel), sauce hamburger [eau, tomato ketchup (concentré de tomate, sirop de glucose-fructose, vinaigre d\'alcool, sucre, amidon transformé, sel, acidifiant : e270, épices), huile de colza, moutarde douce (eau, graines de moutarde, vinaigre, sel, épice, arômes, conservateur : sulfite acide de sodium), cornichons (cornichons, vinaigre, sel), sucre, amidon transformé, vinaigre d\'alcool, concentré de tomates, oignons, sel, conservateur : e202, arôme naturel, colorant : e160c], cheddar orange fondu 9,7% (cheddar orange 4,8% minimum, fromages, eau, beurre, protéines de lait, amidon transformé, sels de fonte : e331 et e452, lactosérum, sel, arôme, gélifiant : e407, colorant : e160b), filet de bacon fumé 6,4% (viande de porc 6,1%, sel, dextrose, sirop de glucose, conservateurs : e250 et e252, antioxydant : e301, aromes naturels, ail), cornichon au vinaigre 2,6% (cornichons, eau, vinaigre d\'alcool, sel, affermissant : e509, conservateur : disulfite de potassium).', 'https://static.openfoodfacts.org/images/products/328/304/005/7426/front_fr.14.400.jpg', '6', '2.8', '19.6', '3.6', '1.9', '6.6', '0.7', '0.275590551181102', '', '1');

