VALUES ('3283040125088', 'Pizza jambon de dinde emmental gouda', 'pâte cuite 43,2% (farine de blé, poudre a lever : E500, huile de colza, sel, eau, levure Eulangère), sauce tomate cuite (purée de tomates mi-t -duite, eau, farine de blé, huile d\'olive vierge, pulpe d\'ail, basilic en poudre, origan en poudre), jambon de dinde oandard cuit halal 14,6% (viande de cuisse de dinde traitée en salaison 9,8% (origine : France), eau, amidon de maïs, antioxydants : E325 et E301, sel, dextrose de blé, gluten de blé, arômes naturels, stabilisants : E450 et E451, gélifiant : E407, conservateur : E250), emmental 8,6% (dont fécule de pomme de terre), gouda 6,5%, origan, basilic. Cette recette contient : gluten, lait. Traces de crustacés, mollusques, œufs, poissons et fruits à coque.', 'https://static.openfoodfacts.org/images/products/328/304/012/5088/front_fr.4.400.jpg', '6.2', '3.1', '31', '2', '2.5', '12', '1.5', '0.590551181102362', '', '0');

