VALUES ('3283040154774', 'Maxi burger cheddar', 'Pain spécial 42,5% [farine de blé, eau, levure, dextrose, huile de colza, gluten de blé, sucre, graines de sésame, sel, farine de fève, conservateur : propionate de calcium, émulsifiants : mono et diglycérides d\'acides gras esters monoacétyltartriques et diacétyltartriques des mono et diglycérides d\'acides gras, agent de traitement de la farine : acide ascorbique), steak haché pur boeuf cuit 35% (origine : France), cheddar orange fondu 10% [cheddar orange 5% minimum, fromages, eau, beurre, protéines de lait, amidon modifié, sels émulsifiants : citrates dé sodium et polyphosphates, lactosérum, sel, arôme, gélifiant : carraghènanes, colorant : rocou], mayonnaise allégée en matières grasses 3,9% [eau, huile de colza 1,2%, vinaigre d\'alcool, jaune d\'œuf 0,2%, amidon modifié, sucre, moutarde de Dijon (eau, graines de moutarde, vinaigre, sel), sel, lait écrémé reconstitué, acidifiant : acide citrique, épaississant : gomme xanthanell crème fraîche légère épaisse amidons modifiés, épaississant : pectines, ferments lactiques), fromage frais à la ciboulette (fromage, sel, ciboulette), arôme chargrill 0,9%. Traces éventuelles de poisson, soja, sésame et fruits à coque. Conseil de préparation : MICRO-ONDES : Réchauffer le buger dans son emballage pendant 70 sec à 900W. Attendez vant d\'ouvrir car le burger est très chaud.', 'https://static.openfoodfacts.org/images/products/328/304/015/4774/front_fr.4.400.jpg', '13', '5.5', '23', '4.2', '', '14', '1.14', '0.448818897637795', '', '0');

